-- Volcando estructura para procedimiento credito_prod.pageografia
DELIMITER //
CREATE PROCEDURE `pageografia`(
	IN `idpro` INT,
	IN `idcan` INT,
	IN `iddis` INT,
	IN `idbar` INT
)
BEGIN
	SELECT 
		cast(CONCAT(provincia.id, canton.id, distrito.id, barrio.id) AS INTEGER) AS id,
		provincia.id AS idprovincia,
		provincia.codigo AS codigoprovincia,
		provincia.provincia,
		canton.id AS idcanton,
		canton.codigo AS codigocanton,
		canton.canton,
		distrito.id AS iddistrito,
		distrito.codigo AS codigodistrito,
		distrito.distrito,
		barrio.id AS idbarrio,
		barrio.codigo AS codigobarrio,
		barrio.barrio 
	FROM barrio
	INNER JOIN distrito ON barrio.iddistrito = distrito.id
	INNER JOIN canton ON distrito.idcanton = canton.id
	INNER JOIN provincia ON canton.idprovincia = provincia.id
	WHERE provincia.id = idpro
	AND canton.id = idcan
	AND distrito.id = iddis
	AND barrio.id = idbar;
END//
DELIMITER ;

-- Volcando estructura para procedimiento credito_prod.pageografia_all
DELIMITER //
CREATE PROCEDURE `pageografia_all`()
BEGIN
	SELECT 
		cast(CONCAT(provincia.id, canton.id, distrito.id, barrio.id) AS INTEGER) AS id,
		provincia.id AS idprovincia,
		provincia.codigo AS codigoprovincia,
		provincia.provincia,
		canton.id AS idcanton,
		canton.codigo AS codigocanton,
		canton.canton,
		distrito.id AS iddistrito,
		distrito.codigo AS codigodistrito,
		distrito.distrito,
		barrio.id AS idbarrio,
		barrio.codigo AS codigobarrio,
		barrio.barrio 
	FROM barrio
	INNER JOIN distrito ON barrio.iddistrito = distrito.id
	INNER JOIN canton ON distrito.idcanton = canton.id
	INNER JOIN provincia ON canton.idprovincia = provincia.id;
END//
DELIMITER ;

-- Volcando estructura para procedimiento credito_prod.PRO_recalcular_ahorros
DELIMITER //
CREATE PROCEDURE `PRO_recalcular_ahorros`()
BEGIN
	-- Recalcular el saldo de todos los ahorros
	UPDATE ahorros_cliente ah
		SET ah.saldo = (
			SELECT 
				sum(if(am.tipo_mov = 0, am.monto, am.monto *-1))
			FROM ahorros_movimiento am
			WHERE am.cliente_id = ah.cliente_id AND am.producto_id = ah.producto_id
		);	
END//
DELIMITER ;

-- Volcando estructura para procedimiento credito_prod.PRO_Recalcular_creditos
DELIMITER //
CREATE PROCEDURE `PRO_Recalcular_creditos`(
	IN `p_operacion` INT,
	IN `p_fecha` DATE
)
    COMMENT 'Recalcula los saldo en cxc y luego los créditos basándose en los pagos aplicados'
BEGIN
	DECLARE msg VARCHAR(200);
	
	DECLARE EXIT HANDLER FOR SQLEXCEPTION

	BEGIN
	   	ROLLBACK;
	   	SET msg = CONCAT('BD - No fue posible recalcular el saldo de la operación # ', CAST(p_operacion AS VARCHAR(10)));
	   	
	   	GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
			@errno = MYSQL_ERRNO, @text = MESSAGE_TEXT;
			SET @full_error = CONCAT(msg, " ERROR ", @errno, " (", @sqlstate, "): ", @text);
		SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = @full_error;
	END;
	
	START TRANSACTION;
	
	-- Recalcular los registros en la tabla cxc
	UPDATE cxc 
	SET saldo_interes_corriente = monto_interes_corriente - 	IFNULL((SELECT SUM(monto_interes_corriente) FROM pago WHERE cxc_id = cxc.id),0),
		saldo_interes_moratorio = 	monto_interes_moratorio - 	IFNULL((SELECT SUM(monto_interes_moratorio) FROM pago WHERE cxc_id = cxc.id),0),
		saldo_principal =  		   monto_principal -   		   IFNULL((SELECT SUM(monto_principal) FROM pago WHERE cxc_id = cxc.id),0)
	WHERE operacion = p_operacion;
	
	COMMIT;
	
	
	-- Recalcular el campo saldo_credito de la tabla cxc
	SELECT monto_aprobado INTO @saldo FROM credito WHERE operacion = p_operacion;
	
	CREATE TEMPORARY TABLE tmp_calculo_cxc
		SELECT 
			cxc.id, 
			(@saldo := @saldo - (monto_principal + (saldo_principal * -1))) AS saldo_credito
		FROM cxc
		WHERE cxc.operacion = p_operacion;
		
	UPDATE cxc, tmp_calculo_cxc
		SET cxc.saldo_credito = tmp_calculo_cxc.saldo_credito
	WHERE cxc.id = tmp_calculo_cxc.id;
	
	DROP TABLE tmp_calculo_cxc;
	
			
	-- Recalcular el monto del interés moratorio (si la configuración lo permite y si el cliente no está excento de mora).
	-- Solo calcula el interés para pagos vencidos.
	IF (SELECT aplicar_interes_moratorio FROM config) = 'S' THEN 
	
		-- Drop table y create table llevan un commit implícito
		
		DROP TABLE if EXISTS tmp_calculo_cxc;
		
		-- Si los días de vencido no superan a los días de gracia, tampoco se calcula el interés moratorio
		CREATE TEMPORARY TABLE tmp_calculo_cxc
			SELECT 
				cxc.id, 
				-- Se debe usar el saldo real del crédito para calcular la mora, no el saldo proyectado
				-- ROUND(if(cxc.saldo_credito > 0, cxc.saldo_credito, credito.saldo) * (credito.tasa_mora / 12 / 100) / 30 * fun_dias_mora(cxc.fecha), 2) AS monto_mora,
				ROUND(credito.saldo * (credito.tasa_mora / 12 / 100) / 30 * fun_dias_mora(cxc.fecha), 2) AS monto_mora,
				IFNULL((SELECT SUM(monto_interes_moratorio) FROM pago WHERE cxc_id = cxc.id),0) AS monto_pagado_mora
			FROM cxc 
			INNER JOIN credito ON cxc.operacion = credito.operacion
			INNER JOIN linea ON credito.linea_id = linea.id
			INNER JOIN cliente ON credito.cliente_id = cliente.id
			WHERE cxc.operacion = p_operacion
			AND cxc.saldo_principal > 0
			AND cxc.fecha < date(p_fecha)
			AND TIMESTAMPDIFF(DAY, cxc.fecha, date(p_fecha)) > cliente.dias_gracia_mora
			AND cliente.sin_interes_moratorio = 0
			ORDER BY cxc.operacion, cxc.fecha;
		
		-- CREATE INDEX tmp_idx ON tmp_calculo_cxc (id); -- No es necesario para una sola operación
		
		START TRANSACTION;
		
		-- Si el monto calculado de interés moratorio es inferior al que ya había sido calculdo es
		-- porque ahora se está calculando sobre un saldo menor y por lo tanto no se debe modificar.
		UPDATE cxc, tmp_calculo_cxc
			SET cxc.monto_interes_moratorio = if(tmp_calculo_cxc.monto_mora <= cxc.monto_interes_moratorio, cxc.monto_interes_moratorio, tmp_calculo_cxc.monto_mora)
		WHERE cxc.id = tmp_calculo_cxc.id;
		
		-- Se hace este segundo update para actualizar otro campo ya que no funciona si se hace en un solo update separado por comas
		UPDATE cxc, tmp_calculo_cxc
			SET cxc.saldo_interes_moratorio = cxc.monto_interes_moratorio - tmp_calculo_cxc.monto_pagado_mora
		WHERE cxc.id = tmp_calculo_cxc.id;
		
		COMMIT;
		
		DROP TABLE tmp_calculo_cxc;
		
	END if;
	
	-- El procedimiento PRO_Recalcular_creditos_frac_mora() se estuvo ejecutando y provocó cálculos de mora para registros no vencidos.
	-- Este código corrige esa situación.
	START TRANSACTION;
	UPDATE cxc 
		SET monto_interes_moratorio = 0, saldo_interes_moratorio = 0 
	WHERE operacion = p_operacion
	and fecha > DATE(NOW())
	AND monto_interes_moratorio > 0
	AND NOT EXISTS(SELECT id FROM pago WHERE cxc_id = cxc.id);
	
	COMMIT;
	
	START TRANSACTION;
	
	-- Recalcular el saldo del crédito en base a los pagos
	UPDATE credito
		SET saldo = monto_aprobado - 
			IFNULL((SELECT SUM(monto_principal - saldo_principal) FROM cxc WHERE operacion = credito.operacion),0)
	WHERE operacion = p_operacion;
	
	-- Recalcular la fecha del último pago completo
	UPDATE credito
		SET fecha_ultimo_pago_completo = 
			IFNULL((SELECT MAX(fecha) FROM cxc WHERE operacion = p_operacion AND saldo_principal <= 0), fecha_ultimo_pago_completo)
	WHERE operacion = p_operacion 
	AND EXISTS (SELECT id FROM desembolso WHERE operacion = credito.operacion) 
	AND saldo < monto_aprobado;
	
	COMMIT;
	
	-- Recalcular el interés moratorio correspondiente a la fracción de días del mes en curso, si la operación está morosa.
	-- CALL PRO_Recalcular_creditos_frac_mora(p_operacion);
	
	-- Recalcular el monto y el saldo del principal para los registros morosos.
	CALL PRO_Recalcular_principal_mora(p_operacion);
END//
DELIMITER ;

-- Volcando estructura para procedimiento credito_prod.PRO_Recalcular_creditos_frac_mora
DELIMITER //
CREATE PROCEDURE `PRO_Recalcular_creditos_frac_mora`(
	IN `p_operacion` INT
)
    COMMENT 'Recalcula los intereses moratorios correspondientes a la facción del mes en curso'
BEGIN
	DECLARE msg VARCHAR(200);
	
	DECLARE EXIT HANDLER FOR SQLEXCEPTION

	BEGIN
	   	ROLLBACK;
	   	SET msg = CONCAT('BD - No fue posible recalcular el saldo de la operación # ', CAST(p_operacion AS VARCHAR(10)));
	   	
	   	GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
			@errno = MYSQL_ERRNO, @text = MESSAGE_TEXT;
			SET @full_error = CONCAT(msg, " ERROR ", @errno, " (", @sqlstate, "): ", @text);
		SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = @full_error;
	END;
	
	
	-- Recalcular el monto del interés moratorio (si la configuración lo permite y si el cliente no está excento de mora).
	IF (SELECT aplicar_interes_moratorio FROM config) = 'S' THEN 
	
		START TRANSACTION;
		
		-- Recalcular los intereses moratorios para registros no vencidos pero que corresponden a operaciones morosas.
		CREATE TEMPORARY TABLE tmp_calculo_cxc
			SELECT 
				cxc.id, 
				ROUND(IF(cxc.saldo_credito > 0, cxc.saldo_credito, credito.saldo) * (credito.tasa_mora / 12 / 100) / 30 * FUN_dias_mora(IF( MONTH(cxc.fecha) != 2, DATE_ADD(cxc.fecha, INTERVAL -1 MONTH), LAST_DAY(DATE_ADD(cxc.fecha, INTERVAL -1 MONTH))  )), 2) AS monto_mora,
				IF(cxc.saldo_interes_moratorio > 0, ROUND(cxc.monto_interes_moratorio - cxc.saldo_interes_moratorio, 2), 0) AS monto_pagado_mora
			FROM cxc 
			INNER JOIN credito ON cxc.operacion = credito.operacion
			INNER JOIN linea ON credito.linea_id = linea.id
			INNER JOIN cliente ON credito.cliente_id = cliente.id
			WHERE cxc.operacion = p_operacion
			-- AND cxc.saldo_principal > 0
			AND cxc.fecha > CURRENT_DATE 
			AND cliente.sin_interes_moratorio = 0
			AND cxc.operacion IN (SELECT credito_id FROM vcuotas_atrasadas)
			ORDER BY cxc.operacion, cxc.fecha;
		
		UPDATE cxc, tmp_calculo_cxc
			SET cxc.monto_interes_moratorio = tmp_calculo_cxc.monto_mora,
			cxc.saldo_interes_moratorio = tmp_calculo_cxc.monto_mora - tmp_calculo_cxc.monto_pagado_mora
		WHERE cxc.id = tmp_calculo_cxc.id;
		
		COMMIT;
		
		DROP TABLE tmp_calculo_cxc;
		
	END if;
		
END//
DELIMITER ;

-- Volcando estructura para procedimiento credito_prod.PRO_Recalcular_principal_mora
DELIMITER //
CREATE PROCEDURE `PRO_Recalcular_principal_mora`(
	IN `p_operacion` INT
)
    COMMENT 'Recalcula los el monto del principal para los registros morosos'
BEGIN
	DECLARE msg VARCHAR(200);
	
	DECLARE idMin INT;
	DECLARE idMax INT;
	
	DECLARE saldoAnterior DECIMAL(25,6);
	DECLARE saldoActual DECIMAL(25,6);
	
	DECLARE montoPrincipal DECIMAL(25,6);
	DECLARE saldoPrincipal DECIMAL(25,6);
	
	DECLARE principalAdicional DECIMAL(25,6);
	
	DECLARE EXIT HANDLER FOR SQLEXCEPTION

	BEGIN
	   	ROLLBACK;
	   	SET msg = CONCAT('BD - No fue posible recalcular el saldo en mora de la operación # ', CAST(p_operacion AS VARCHAR(10)));
	   	
	   	GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
			@errno = MYSQL_ERRNO, @text = MESSAGE_TEXT;
			SET @full_error = CONCAT(msg, " ERROR ", @errno, " (", @sqlstate, "): ", @text);
		SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = @full_error;
	END;
	
	-- Establecer el monto inicial
	SELECT monto_aprobado INTO saldoAnterior
	FROM credito WHERE operacion = p_operacion;
	
	-- Recalcular los campos monto_principal y saldo_principal para los registros morosos.
	-- Uso campos de trabajo como apoyo para generar la proyección de saldos de los registros en mora.
	DROP TABLE if EXISTS tmp_calculo_cxc_principal;
	
	CREATE TEMPORARY TABLE tmp_calculo_cxc_principal
		SELECT 
			saldoAnterior AS saldo_anterior,
			cxc.operacion,
			cxc.id,
			monto_principal,
			saldo_principal, 
			saldoAnterior AS saldo_actual
		FROM cxc 
		WHERE cxc.operacion = p_operacion
		AND cxc.operacion IN (SELECT credito_id FROM vcuotas_atrasadas)
		ORDER BY cxc.id;
	
	SELECT MIN(id), MAX(id) INTO idMin, idMax
	FROM tmp_calculo_cxc_principal;
	
	WHILE idMin <= idMax DO
		-- Poner las variables de cálculo en cero.
		SET montoPrincipal = 0;
		SET saldoPrincipal = 0;
		SET principalAdicional = 0;
		
		-- Obtener el monto y el saldo principal (actuales).
		SELECT 
			monto_principal, saldo_principal 
		INTO montoPrincipal, saldoPrincipal
		FROM tmp_calculo_cxc_principal 
		WHERE id = idMin;
		
		-- Si el select no econtró el id entonces pongo los montos en cero.
		SET montoPrincipal = IFNULL(montoPrincipal, 0);
		SET saldoPrincipal = IFNULL(saldoPrincipal, 0);
		
		-- Si el saldo de un registro en cxc queda negativo es porque se hizo un aporte adicional al pago ordinario.
		IF saldoPrincipal < 0 THEN
			SET principalAdicional = ABS(saldoPrincipal);
		END IF;
		
		IF montoPrincipal > saldoAnterior THEN 
			SET montoPrincipal = saldoAnterior;
		END IF;
		
		IF saldoPrincipal > montoPrincipal THEN
			SET saldoPrincipal = montoPrincipal;
		END IF;
		
		if saldoPrincipal <= 0 then
			SET saldoActual = saldoAnterior - montoPrincipal - principalAdicional;
		END if;
		
		
		UPDATE tmp_calculo_cxc_principal
		SET 	saldo_anterior = saldoAnterior, 
			monto_principal = montoPrincipal, 
			saldo_principal = saldoPrincipal,
			saldo_actual = saldoActual
		WHERE id = idMin;
		
		SET saldoAnterior = saldoActual;
		
		SELECT MIN(id) INTO idMin
		FROM tmp_calculo_cxc_principal WHERE id > idMin;
	END WHILE;
	
	START TRANSACTION;
	
	-- Una vez realizado el cálculo en la tabla de trabajo procedo
	-- a actualizar la tabla viva y a eliminar la de trabajo.
	UPDATE cxc, tmp_calculo_cxc_principal
		SET cxc.monto_principal = tmp_calculo_cxc_principal.monto_principal,
		    cxc.saldo_principal = tmp_calculo_cxc_principal.saldo_principal
	WHERE cxc.id = tmp_calculo_cxc_principal.id;
	
	COMMIT;
	
	DROP TABLE tmp_calculo_cxc_principal;
	
END//
DELIMITER ;

-- Volcando estructura para procedimiento credito_prod.PRO_Tabla_movimientos
DELIMITER //
CREATE PROCEDURE `PRO_Tabla_movimientos`(
	IN `p_operacion` INT,
	IN `p_documento` VARCHAR(15),
	IN `p_fecha` DATE
)
    COMMENT 'Genera una tabla con todos los movimientos de un crédito mostrando el saldo en cada uno de ellos'
BEGIN

	-- Generar todos los movimientos para una operación
	
	-- DATOS
	-- Cliente	Operación		Saldo anterior		Pago		Fecha	Documento		Tipo abono	Int Moratorio	Int Corriente	Principal	Saldo actual
	
	-- Si el parámetro p_documento viene nulo o vacío no se hace ningún filtro.
	-- Pero si trae algún valor se usará junto con el parámetro p_fecha para filtrar los datos a mostrar.
	-- Ese filtro se usará para los recibos.
	
	SET @vrow_no := 0;
	DROP TABLE if EXISTS tmp_movimientos;
	
	CREATE TEMPORARY TABLE tmp_movimientos
		SELECT 
			cliente,
			operacion,
			monto_principal * 0 AS saldo_anterior,
			(monto_interes_corriente + monto_interes_moratorio + monto_principal) AS pago,
			fecha_pagado,
			documento,
			tipo_abono,
			monto_interes_moratorio,
			monto_interes_corriente,
			monto_principal,
			monto_principal * 0 AS saldo_actual,
			(@vrow_no := @vrow_no + 1) as row_no
		FROM vpago
		WHERE operacion = p_operacion
		ORDER BY fecha_pagado, documento;
		
	-- Calcular las columnas de saldo anterior y saldo actual
	SET @vsaldo_anterior = (SELECT monto_aprobado FROM credito WHERE operacion = p_operacion);
	SET @last_row = (SELECT MAX(row_no) FROM tmp_movimientos);
	SET @vrow_no := (SELECT MIN(row_no) FROM tmp_movimientos);
	
	WHILE @vrow_no <= @last_row DO 
		UPDATE tmp_movimientos 
			SET saldo_anterior = @vsaldo_anterior, saldo_actual = @vsaldo_anterior - monto_principal
		WHERE row_no = @vrow_no;
		
		SET @vsaldo_anterior = (Select saldo_actual FROM tmp_movimientos WHERE row_no = @vrow_no);
		SET @vrow_no := @vrow_no + 1;
		
	END WHILE;
	
	-- Devolver la tabla calculada y eliminarla de la base de datos
	if p_documento IS NULL OR p_documento = '' then 
		SELECT 
			(Select company_name FROM config LIMIT 1) AS company,
			tmp_movimientos.*
		FROM tmp_movimientos ORDER BY row_no;
	ELSE 
		SELECT 
			(Select company_name FROM config LIMIT 1) AS company,
			tmp_movimientos.*
		FROM tmp_movimientos 
		WHERE documento = p_documento and fecha_pagado = p_fecha ORDER BY row_no;
	END if;
	
	DROP TABLE tmp_movimientos;
END//
DELIMITER ;

-- Volcando estructura para procedimiento credito_prod.PRO_Tabla_movimientos_dif
DELIMITER //
CREATE PROCEDURE `PRO_Tabla_movimientos_dif`(
	IN `p_operacion` INT
)
    COMMENT 'Genera una tabla con todos los movimientos de un crédito mostrando el saldo en cada uno de ellos'
BEGIN

	-- Generar todos los movimientos para una operación
	
	-- DATOS
	-- Cliente	Operación		Saldo anterior		Pago		Fecha	Documento		Tipo abono	Int Moratorio	Int Corriente	Principal	Saldo actual
	
	SET @vrow_no := 0;
	SET @tasa := (SELECT tasa_anual / 12 / 100 FROM credito WHERE operacion = p_operacion);
	
	DROP TABLE if EXISTS tmp_movimientos;
	
	CREATE TEMPORARY TABLE tmp_movimientos
		SELECT 
			cliente,
			operacion,
			monto_principal * 0 AS saldo_anterior,
			(monto_interes_corriente + monto_interes_moratorio + monto_principal) AS pago,
			fecha_pagado,
			documento,
			tipo_abono,
			monto_interes_moratorio,
			monto_interes_corriente,
			monto_interes_corriente * 0 AS interes_calculado,
			monto_interes_corriente * 0 AS interes_dif,
			monto_principal,
			monto_principal * 0 AS saldo_actual,
			(@vrow_no := @vrow_no + 1) as row_no
		FROM vpago
		WHERE operacion = p_operacion
		ORDER BY fecha_pagado, documento;
		
	-- Calcular las columnas de saldo anterior y saldo actual
	SET @vsaldo_anterior = (SELECT monto_aprobado FROM credito WHERE operacion = p_operacion);
	SET @last_row = (SELECT MAX(row_no) FROM tmp_movimientos);
	SET @vrow_no := (SELECT MIN(row_no) FROM tmp_movimientos);
	
	WHILE @vrow_no <= @last_row DO 
		UPDATE tmp_movimientos 
			SET 	saldo_anterior = @vsaldo_anterior, 
				saldo_actual = @vsaldo_anterior - monto_principal, 
				interes_calculado = if(monto_interes_corriente > 0, @vsaldo_anterior * @tasa, 0),
				interes_dif = interes_calculado - monto_interes_corriente
		WHERE row_no = @vrow_no;
		
		SET @vsaldo_anterior = (Select saldo_actual FROM tmp_movimientos WHERE row_no = @vrow_no);
		SET @vrow_no := @vrow_no + 1;
		
	END WHILE;
	
	-- Devolver la tabla calculada y eliminarla de la base de datos
	
	SELECT 
		tmp_movimientos.*
	FROM tmp_movimientos ORDER BY row_no;

	
	DROP TABLE tmp_movimientos;
END//
DELIMITER ;

-- Volcando estructura para función credito_prod.FUN_ahorro_saldo_anterior
DELIMITER //
CREATE FUNCTION `FUN_ahorro_saldo_anterior`(`p_id` INT
) RETURNS decimal(20,6)
    COMMENT 'Determina el saldo anterior considerando el orden del campo id, que es autogenerado.'
BEGIN
	DECLARE v_cliente_id INT;
	DECLARE v_saldo DECIMAL(20,6);
	
	-- Obtengo el cliente
	SELECT cliente_id INTO v_cliente_id FROM ahorros_movimiento WHERE id = p_id;
	
	-- Sumo y resto los movimientos de acuerdo con su tipo [tipo_mov (0=Ingreso, 1=Egreso)]
	SELECT SUM(if(tipo_mov = 0, monto, -monto)) 
		INTO v_saldo 
	FROM ahorros_movimiento 
	WHERE id < p_id
	AND cliente_id = v_cliente_id;
	
	SET v_saldo = IFNULL(v_saldo, 0.00);
	
	RETURN v_saldo;
END//
DELIMITER ;

-- Volcando estructura para función credito_prod.FUN_dias_mora
DELIMITER //
CREATE FUNCTION `FUN_dias_mora`(`vence` DATE
) RETURNS int(11)
    COMMENT 'Determinar los días de mora basándose en la fecha recibida'
BEGIN
	-- 1. Determinar si la fecha está vencida
	-- 2. Calcular los días de vencida
	-- 3. Si los días de vencida son mayores que los días del mes de la fecha de vencimiento 
	--	 entonces setear la cantidad de días igual al total de días del mes de vencimiento,
	--	 caso contrario los días serán el cálculo inicial.
	--	 Nota: si el mes es febrero los días serán 30 en vez del número de días que tenga febrero.
	
	
	SET @dias = 0;
	SET @dias_calendario = DAY(LAST_DAY(vence));
	
	IF (vence >= CURRENT_DATE) then
		RETURN 0;
	END IF;
	
	SET @dias = TIMESTAMPDIFF(DAY, vence, CURRENT_DATE);
	
	IF (@dias > DAY(vence)) then
		SET @dias = IF(@dias_calendario < 30, 30, @dias_calendario); -- Si es febrero cuenta como 30 (base 360)
	END if;
	
	
	RETURN @dias;
	
END//
DELIMITER ;

-- Volcando estructura para función credito_prod.getCuota
DELIMITER //
CREATE FUNCTION `getCuota`(`p_operacion` INT
) RETURNS decimal(20,6)
    COMMENT 'Obtener la cuota real de un crédito'
BEGIN
	-- Variables para el cálculo
	DECLARE v_saldo DECIMAL(20,6);
	DECLARE v_cuota DECIMAL(20,6);
	DECLARE v_cuota_cxc DECIMAL(20,6);
	DECLARE v_pago DECIMAL(20,6);
	DECLARE v_sado_cxc DECIMAL(20,6);
	DECLARE v_numero_cuotas INTEGER;
	
	SET v_sado_cxc = 0.0;
	SET v_numero_cuotas = 0;
	
	-- Obtengo el saldo y la cuota
	SELECT pago, saldo, pago, plazo_meses into v_cuota, v_saldo, v_pago, v_numero_cuotas FROM credito WHERE operacion = p_operacion;
	
	-- Si la operación no tiene pagos y está pactada a un solo pago la cuota es el campo pago
	if (v_numero_cuotas = 1) then
		SELECT 
			( monto_interes_corriente - saldo_interes_corriente 
			+ monto_interes_moratorio - saldo_interes_moratorio 
			+ monto_principal - saldo_principal
			) saldo_cxc
		INTO v_sado_cxc
		FROM cxc 
		WHERE operacion = p_operacion;
		
		if v_sado_cxc = 0 then
			SET v_cuota = v_pago;
		END if;
	ELSE
		-- Si la cuota es mayor que el saldo hay que sumar los registros de cxc
		if v_cuota > v_saldo then 
			SELECT 
				SUM(If(saldo_interes_corriente > 0,saldo_interes_corriente,0) + If(saldo_interes_moratorio > 0, saldo_interes_moratorio,0) + If(saldo_principal > 0, saldo_principal,0)) AS cuota
			INTO v_cuota_cxc
			FROM cxc 
			WHERE operacion = p_operacion 
			AND fecha <= LAST_DAY(NOW())
			AND (saldo_interes_corriente > 0 OR saldo_interes_moratorio > 0 OR saldo_principal > 0);
			
			SET v_cuota_cxc = IFNULL(v_cuota_cxc,0);
			
			if v_cuota_cxc > v_saldo then  
				SET v_cuota = v_cuota_cxc;
			ELSE 
				SET v_cuota = v_saldo;
			END if;
		END if;
	END if;

	RETURN v_cuota;	
END//
DELIMITER ;

-- Volcando estructura para disparador credito_prod.credito_audit
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION';
DELIMITER //
CREATE TRIGGER `credito_audit` AFTER UPDATE ON `credito` FOR EACH ROW BEGIN
	-- Determinar si estos campos fueron cambiados
    if (NEW.linea_id   != OLD.linea_id or
	   NEW.cliente_id != OLD.cliente_id or
	   NEW.monto_solicitado != OLD.monto_solicitado or
	   NEW.fecha_solicitud != OLD.fecha_solicitud or
	   NEW.monto_aprobado != OLD.monto_aprobado or
	   NEW.tasa_anual != OLD.tasa_anual or
	   NEW.plazo_meses != OLD.plazo_meses or
	   NEW.ajuste_dias != OLD.ajuste_dias or
	   NEW.pago != OLD.pago or
	   NEW.aporte_solidario != OLD.aporte_solidario or
	   NEW.tramite_administrativo != OLD.tramite_administrativo OR 
	   NEW.diastasafija != OLD.diastasafija) THEN
	   
		`operacion`,
		`linea_id`,
		`cliente_id`,
		`monto_solicitado`,
		`fecha_solicitud`,
		`monto_aprobado`,
		`fecha_aprobado`,
		`tasa_anual`,
		`plazo_meses`,
		`tasa_mora`,
		`ajuste_dias`,
		`monto_ajuste_dias`,
		`fecha_proximo_pago`,
