DELIMITER //
CREATE TRIGGER `credito_before_delete` BEFORE DELETE ON `credito` FOR EACH ROW BEGIN
	DECLARE msg VARCHAR(200);
	-- Un crédito se considera desembolsado si existe al menos un registro en la tabla desembolso
	-- No se permite eliminar créditos desembolsados
	if (EXISTS (SELECT * FROM desembolso WHERE operacion = OLD.operacion)) then
		SET msg = CONCAT('BD - La operación # ', CAST(OLD.operacion AS VARCHAR(10)),  ' está en estado de DESEMBOLSADO y por lo tanto no se puede eliminar.');
		SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = msg;
	END if;
