DELIMITER //
CREATE TRIGGER `cxc_before_delete` BEFORE DELETE ON `cxc` FOR EACH ROW BEGIN
	-- Actualizo el maestro de créditos ya que el saldo debe variar
	UPDATE credito SET saldo = saldo + (OLD.monto_principal - OLD.saldo_principal) WHERE operacion = OLD.operacion;
	
