-- Volcando estructura para disparador credito_prod.movimiento_ah_before_delete
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION';
DELIMITER //
CREATE TRIGGER `movimiento_ah_before_delete` BEFORE DELETE ON `ahorros_movimiento` FOR EACH ROW BEGIN
	DECLARE vIngresos DECIMAL(20,6);
	DECLARE vEgresos DECIMAL(20,6);
	
	
	-- Calcular saldos
	-- La sumatoria excluye el movimiento borrado (before delete)
	SELECT 
		sum(if(a.tipo_mov = 0, a.monto, 0)),
		sum(if(a.tipo_mov = 1, a.monto, 0))
	INTO vIngresos, vEgresos
	FROM ahorros_movimiento a
	WHERE a.cliente_id = OLD.cliente_id AND a.producto_id = OLD.producto_id
	AND a.id <> OLD.id;
	
	
	if (vIngresos IS NULL) then
		SET vIngresos = 0;
	END IF;
	
	if (vEgresos IS NULL) then
		SET vEgresos = 0;
	END IF;
	
	UPDATE ahorros_cliente a
		SET a.saldo = vIngresos  - vEgresos
	WHERE a.cliente_id = OLD.cliente_id AND a.producto_id = OLD.producto_id;
	
	
	-- Actualizar la tabla de auditoría
		`id`,
		`cliente_id`,
		`producto_id`,
		`fecha`,
		`documento`,
		`tipo_doc`,
		`banco_id`,
		`tipo_monto`,
		`tipo_mov`,
		`monto`,
		`accion`,
		`fecha_estado`,
		`ref`
		)
	VALUES(
		OLD.`id`,
		OLD.`cliente_id`,
		OLD.`producto_id`,
		OLD.`fecha`,
		OLD.`documento`,
		OLD.`tipo_doc`,
		OLD.`banco_id`,
		OLD.`tipo_monto`,
		OLD.`tipo_mov`,
		OLD.`monto`,
		'D',
		NOW(),
		OLD.ref
		);
END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;

