-- Volcando estructura para disparador credito_prod.pago_after_update
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION';
DELIMITER //
CREATE TRIGGER `pago_after_update` AFTER UPDATE ON `pago` FOR EACH ROW /*
Este trigger tiene la función de un foreign key
*/
BEGIN
	DECLARE msg VARCHAR(200);
	DECLARE vmonto DECIMAL(20,6);
	DECLARE vmontoAplicado DECIMAL(20,6);
	DECLARE vsaldo DECIMAL(20,6);
	
	DECLARE EXIT HANDLER FOR SQLEXCEPTION

	BEGIN
		-- Nota: cualquier error generado en un trigger dispara un rollback automáticamente
	   	SET msg = CONCAT('BD - [UPDATE] El ID del fiador ', CAST(NEW.pagado_por_fiador AS VARCHAR(10)), ' no es correcto.');
	   	
	   	GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
			@errno = MYSQL_ERRNO, @text = MESSAGE_TEXT;
			SET @full_error = CONCAT(msg, " ERROR ", @errno, " (", @sqlstate, "): ", @text);
		SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = @full_error;
	END;
	
	-- Este trigger solo se dispara si alguien o algo modifica el valor insertado en el campo pagado_por_fiador
	-- pero solo si es un valor mayor que cero.  Esto permite que se quite un fiador si fuera necesario pues cero
	-- significa NINGUNO.
	if (NEW.pagado_por_fiador > 0 AND NEW.pagado_por_fiador <> OLD.pagado_por_fiador) then
	
		if NOT EXISTS(SELECT cedula FROM cliente WHERE id = NEW.pagado_por_fiador) then
			-- Genero un error intencionalmente para que se haga el rollback y se envíe el mensaje al usuario
			SET @temp = 8 / nada;
		END if;
		
	END if;
	
END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;

-- Volcando estructura para disparador credito_prod.pago_before_insert
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION';
DELIMITER //
CREATE TRIGGER `pago_before_insert` BEFORE INSERT ON `pago` FOR EACH ROW BEGIN

	DECLARE msg VARCHAR(200);
	DECLARE vmonto DECIMAL(20,6);
	DECLARE vmontoAplicado DECIMAL(20,6);
	DECLARE vsaldo DECIMAL(20,6);
	
	DECLARE EXIT HANDLER FOR SQLEXCEPTION

	BEGIN
		-- Cualquier error generado en un trigger dispara un rollback automáticamente
	   	SET msg = CONCAT('BD - El saldo del registro en cxc ID # ', CAST(NEW.cxc_id AS VARCHAR(10)), ' iba a quedar negativo.');
	   	
	   	GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
			@errno = MYSQL_ERRNO, @text = MESSAGE_TEXT;
			SET @full_error = CONCAT(msg, " ERROR ", @errno, " (", @sqlstate, "): ", @text);
		SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = @full_error;
	END;
	
	-- Calcular el saldo antes de aplicar el monto
	SELECT monto_interes_moratorio into vmonto FROM cxc WHERE id = NEW.cxc_id;
	SELECT sum(monto_interes_moratorio) into vmontoAplicado FROM pago WHERE cxc_id = NEW.cxc_id;
	
	SET vsaldo = vmonto - IFNULL(vmontoAplicado, 0);
	
	-- Si el saldo va a quedar negativo, genero un error para que el handler lo maneje
	if (vsaldo < 0) then 
		SET @temp = 8 / nada;
	END if;
	
	
END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;

-- Volcando estructura para disparador credito_prod.pago_before_update
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION';
DELIMITER //
CREATE TRIGGER `pago_before_update` BEFORE UPDATE ON `pago` FOR EACH ROW BEGIN

	DECLARE msg VARCHAR(200);
	DECLARE vmonto DECIMAL(20,6);
	DECLARE vmontoAplicado DECIMAL(20,6);
	DECLARE vsaldo DECIMAL(20,6);
	
	DECLARE EXIT HANDLER FOR SQLEXCEPTION

	BEGIN
		-- Cualquier error generado en un trigger dispara un rollback automáticamente
	   	SET msg = CONCAT('BD - [UPDATE] El saldo del registro en cxc ID # ', CAST(NEW.cxc_id AS VARCHAR(10)), ' iba a quedar negativo.');
	   	
	   	GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
			@errno = MYSQL_ERRNO, @text = MESSAGE_TEXT;
			SET @full_error = CONCAT(msg, " ERROR ", @errno, " (", @sqlstate, "): ", @text);
		SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = @full_error;
	END;
	
	-- Calcular el saldo antes de aplicar el monto
	SELECT monto_interes_moratorio into vmonto FROM cxc WHERE id = NEW.cxc_id;
	SELECT sum(monto_interes_moratorio) into vmontoAplicado FROM pago WHERE cxc_id = NEW.cxc_id;
	
	SET vmontoAplicado = vmontoAplicado - OLD.monto_interes_moratorio + NEW.monto_interes_moratorio;
	
	SET vsaldo = vmonto - vmontoAplicado;
	
	-- Si el saldo va a quedar negativo, genero un error para que el handler lo maneje
	if (vsaldo < 0) then 
		SET @temp = 8 / nada;
	END if;
	
	
END//
DELIMITER ;
