-- Volcando estructura para vista credito_prod.geografia
-- Eliminando tabla temporal y crear estructura final de VIEW
DROP TABLE IF EXISTS `geografia`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `geografia` AS SELECT 
	cast(CONCAT(provincia.id, canton.id, distrito.id, barrio.id) AS INTEGER) AS id,
	provincia.id AS idprovincia,
	provincia.codigo AS codigoprovincia,
	provincia.provincia,
	canton.id AS idcanton,
	canton.codigo AS codigocanton,
	canton.canton,
	distrito.id AS iddistrito,
	distrito.codigo AS codigodistrito,
	distrito.distrito,
	barrio.id AS idbarrio,
	barrio.codigo AS codigobarrio,
	barrio.barrio 
FROM barrio
INNER JOIN distrito ON barrio.iddistrito = distrito.id
INNER JOIN canton ON distrito.idcanton = canton.id
INNER JOIN provincia ON canton.idprovincia = provincia.id ;

