CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vcredito_audit` AS SELECT
	credito_audit.*,
	'Auditoría' AS Tabla
FROM credito_audit
UNION ALL 
SELECT
	credito.*,
	'' AS accion,
	0 AS usuario_id_accion,
	NOW() AS fecha_estado,
	'Actual' AS Tabla
FROM credito
ORDER BY operacion, fecha_estado ;

-- Volcando estructura para vista credito_prod.vcuotas_atrasadas
-- Eliminando tabla temporal y crear estructura final de VIEW
DROP TABLE IF EXISTS `vcuotas_atrasadas`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vcuotas_atrasadas` AS SELECT 
	cxc.operacion AS credito_id,
	concat(cliente.nombre,' ', cliente.apellido1, ' ', cliente.apellido2) AS cliente,
	COUNT(cxc.numero_cuota) AS numero_cuotas,
	SUM(
		if(cxc.saldo_interes_corriente < 0, 0, cxc.saldo_interes_corriente) + 
		if(cxc.saldo_interes_moratorio < 0, 0, cxc.saldo_interes_moratorio) + 
		if(cxc.saldo_principal < 0, 0, cxc.saldo_principal)) AS saldo_atrasado,
	SUM(if(cxc.saldo_interes_moratorio < 0, 0, cxc.saldo_interes_moratorio)) AS moratorio
FROM cxc
INNER JOIN credito ON cxc.operacion = credito.operacion
INNER JOIN cliente ON credito.cliente_id = cliente.id
WHERE cxc.fecha < DATE(NOW())
AND (cxc.saldo_interes_corriente > 0
OR cxc.saldo_interes_moratorio > 0
OR cxc.saldo_principal > 0)
GROUP BY cxc.operacion ;

-- Volcando estructura para vista credito_prod.vcxc
-- Eliminando tabla temporal y crear estructura final de VIEW
DROP TABLE IF EXISTS `vcxc`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vcxc` AS SELECT 
	cxc.id,
	concat(cliente.apellido1, ' ', cliente.apellido2, ' ', cliente.nombre) AS nombre,
	cliente.cedula,
	cxc.operacion,
	cxc.saldo_interes_corriente,
	cxc.saldo_interes_moratorio,
	cxc.saldo_principal,
	(
		if(cxc.saldo_interes_corriente < 0, 0, cxc.saldo_interes_corriente) + 
		if(cxc.saldo_interes_moratorio < 0, 0, cxc.saldo_interes_moratorio) + 
		if(cxc.saldo_principal < 0, 0, cxc.saldo_principal)
	) AS total,
	cxc.numero_cuota,
	cxc.fecha
FROM cxc
INNER JOIN credito ON cxc.operacion = credito.operacion
INNER JOIN cliente ON credito.cliente_id = cliente.id
WHERE 
-- (cxc.saldo_interes_corriente + cxc.saldo_interes_moratorio + cxc.saldo_principal) > 0
(
		if(cxc.saldo_interes_corriente < 0, 0, cxc.saldo_interes_corriente) + 
		if(cxc.saldo_interes_moratorio < 0, 0, cxc.saldo_interes_moratorio) + 
		if(cxc.saldo_principal < 0, 0, cxc.saldo_principal)
) > 0
ORDER BY 2, cxc.operacion, cxc.numero_cuota ;

