	cxc.saldo_interes_corriente,
	cxc.saldo_interes_moratorio,
	cxc.saldo_principal,
	(
		if(cxc.saldo_interes_corriente < 0, 0, cxc.saldo_interes_corriente) + 
		if(cxc.saldo_interes_moratorio < 0, 0, cxc.saldo_interes_moratorio) + 
		if(cxc.saldo_principal < 0, 0, cxc.saldo_principal)
	) AS total
FROM cxc
INNER JOIN credito ON cxc.operacion = credito.operacion
INNER JOIN cliente ON credito.cliente_id = cliente.id
WHERE cxc.fecha < DATE(NOW())
-- AND (cxc.saldo_interes_corriente + cxc.saldo_interes_moratorio + cxc.saldo_principal) > 0
AND 
(
		if(cxc.saldo_interes_corriente < 0, 0, cxc.saldo_interes_corriente) + 
		if(cxc.saldo_interes_moratorio < 0, 0, cxc.saldo_interes_moratorio) + 
		if(cxc.saldo_principal < 0, 0, cxc.saldo_principal)
) > 0
ORDER BY 10 desc ;

-- Volcando estructura para vista credito_prod.vestado_cuenta
-- Eliminando tabla temporal y crear estructura final de VIEW
DROP TABLE IF EXISTS `vestado_cuenta`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vestado_cuenta` AS SELECT 
	credito.cliente_id,
	cliente.cedula,
	CONCAT(cliente.nombre, ' ', cliente.apellido1, ' ', cliente.apellido2) AS cliente,
	credito.operacion,
	credito.monto_aprobado AS monto_credito,
	(SELECT MAX(fecha) FROM desembolso WHERE operacion = credito.operacion) AS fecha,
	linea.descrip,
	credito.plazo_meses,
	credito.tasa_anual,
	credito.saldo,
	IF(credito.pago >= IfNull((SELECT 
						sum(saldo_interes_corriente + saldo_interes_moratorio + saldo_principal) 
						FROM cxc 
						WHERE operacion = credito.operacion 
						AND saldo_principal > 0 AND fecha <= last_day(NOW())),0), credito.pago,
					(SELECT 
						sum(saldo_interes_corriente + saldo_interes_moratorio + saldo_principal) 
						FROM cxc 
						WHERE operacion = credito.operacion 
						AND saldo_principal > 0 AND fecha <= last_day(NOW()))) AS monto_cuota,
	IFNULL(ca.numero_cuotas, 0) AS cuotas_a,
	IFNULL(ca.saldo_atrasado,0) AS monto_a,
	(SELECT company_name FROM config LIMIT 1) AS company,
	'Créditos' AS tipo
FROM credito
INNER JOIN cliente ON credito.cliente_id = cliente.id
INNER JOIN linea ON credito.linea_id = linea.id
LEFT JOIN vcuotas_atrasadas ca ON credito.operacion = ca.credito_id
WHERE credito.saldo > 0
UNION ALL 
SELECT 
	a.cliente_id,
	c.cedula,
	concat(c.nombre,  ' ', c.apellido1, ' ', c.apellido2) AS cliente,
	a.producto_id AS operacion,
	0 AS monto_credito,
	DATE(NOW()) AS fecha,
	p.descrip,
	p.mesliq AS plazo_meses,
	p.tasa AS tasa_anual,
	a.saldo,
	a.cuota AS monto_cuota,
	0 AS cuotas_a,
	0 AS monto_a,
	(SELECT company_name FROM config LIMIT 1) AS company,
	'Ahorros' AS tipo
FROM ahorros_cliente a
INNER JOIN cliente c ON a.cliente_id = c.id
INNER JOIN producto p ON a.producto_id = p.id
WHERE a.saldo > 0
ORDER BY 1, 15 DESC ;

-- Volcando estructura para vista credito_prod.vpago
-- Eliminando tabla temporal y crear estructura final de VIEW
DROP TABLE IF EXISTS `vpago`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vpago` AS SELECT 
	pago.id,
	credito.cliente_id,
	cliente.cedula,
	CONCAT(cliente.nombre, ' ', cliente.apellido1, ' ', cliente.apellido2) AS cliente,
	credito.operacion,
	credito.monto_aprobado AS monto_credito,
	(SELECT SUM(monto) FROM desembolso WHERE operacion = credito.operacion) AS monto_desembolsado,
	(SELECT MAX(fecha) FROM desembolso WHERE operacion = credito.operacion) AS fecha,
	linea.descrip,
	credito.saldo,
	cxc.id AS cxc_id,
	cxc.numero_cuota,
	-- Acá si se suman los saldos ya que lo que se busca es el saldo de la cuota.
	-- Cuando se hace un pago extraordinario el saldo de la cuota va a quedar negativa.
	cxc.monto_interes_corriente + cxc.monto_interes_moratorio + cxc.monto_principal AS monto_cuota,
	cxc.saldo_interes_corriente + cxc.saldo_interes_moratorio + cxc.saldo_principal AS saldo_cuota,
	cxc.fecha AS fecha_cobro,
	pago.monto_interes_corriente,
	pago.monto_interes_moratorio,
	pago.monto_principal,
	pago.fecha AS fecha_pagado,
	pago.documento,
	If(pago.tipo_abono = 0, 'Ordinario', 'Extraordinario') AS tipo_abono
FROM pago
INNER JOIN cxc ON pago.cxc_id = cxc.id
INNER JOIN credito ON cxc.operacion = credito.operacion
INNER JOIN cliente ON credito.cliente_id = cliente.id
INNER JOIN linea ON credito.linea_id = linea.id
ORDER BY 1 ;

-- Volcando estructura para vista credito_prod.vutilidad
-- Eliminando tabla temporal y crear estructura final de VIEW
DROP TABLE IF EXISTS `vutilidad`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vutilidad` AS SELECT 
	cr.operacion,
	p.id,
	p.fecha,
	p.monto_principal,
	p.monto_interes_corriente,
	p.monto_interes_moratorio,
	(cr.monto_ajuste_dias / cr.monto_aprobado * p.monto_principal) as interes_ajuste_dias,
	(
		(cr.monto_solicitado * cr.aporte_solidario / 100) / cr.monto_aprobado * p.monto_principal
	) as interes_aporte_solidario,
	(cr.tramite_administrativo / cr.monto_aprobado * p.monto_principal) as tramite_administrativo
FROM pago p
INNER JOIN cxc c ON p.cxc_id = c.id
INNER JOIN credito cr ON c.operacion = cr.operacion
ORDER BY 1 ;

